func (p *Person) TableName() string {
	return "people"
}

func (db database) NewPerson(p Person) error {
	return db.db.Create(&p).Error
}

func (db database) CreateOrEditPerson(m Person) (Person, error) {
	if db.db.Model(&m).Where("id = ?", m.ID).Updates(&m).RowsAffected == 0 {
		db.db.Create(&m)
	}
	return m, nil
}

func (db database) UpdatePersonName(id uint, name string) {
	if id == 0 {
		return
	}
	db.db.Model(&Person{}).Where("id = ?", id).Updates(map[string]interface{}{
		"name": name,
	})
}

func (db database) GetPersonById(id uint) (Person, error) {
	var p Person
	if err := db.db.First(&p, id).Error; err != nil {
		return Person{}, err
	}
	return p, nil
}

func (db database) GetAllPeople() ([]Person, error) {
	var people []Person
	err := db.db.Find(&people).Error
	if err != nil {
		return nil, err
	}
	return people, nil
}

func InitDB() {
	dbURL := os.Getenv("DATABASE_URL")
	if dbURL == "" {
		panic("DB env vars not found")
	}

	var err error

	db, err := gorm.Open(postgres.New(postgres.Config{
		DSN:                  dbURL,
		PreferSimpleProtocol: true,
	}), &gorm.Config{})

	if err != nil {
		panic(err)
	}

	DB.db = db

	db.AutoMigrate(&Person{})
}

func NewRouter() *http.Server {
	r := initChi()

	r.Group(func(r chi.Router) {
		r.Get("/person/{id}", GetPerson)
		r.Post("/person", CreatePerson)
		r.Get("/people", GetPeople)
	})

	PORT := os.Getenv("PORT")
	if PORT == "" {
		PORT = "5002"
	}

	server := &http.Server{Addr: ":" + PORT, Handler: r}

	go func() {
		fmt.Printf("Listening on port %s\n", PORT)
		if err := server.ListenAndServe(); err != nil {
			fmt.Printf("server err: %s\n", err.Error())
		}
	}()

	return server
}

func GetPerson(w http.ResponseWriter, r *http.Request) {
	idstr := chi.URLParam(r, "id")
	id, _ := strconv.Atoi(idstr)
	p, err := DB.GetPersonById(uint(id))
	if err != nil {
		w.WriteHeader(http.StatusInternalServerError)
		json.NewEncoder(w).Encode(err)
		return
	}
	w.WriteHeader(http.StatusOK)
	json.NewEncoder(w).Encode(p)
}

func CreatePerson(w http.ResponseWriter, r *http.Request) {
	p := Person{}
	body, err := io.ReadAll(r.Body)
	if err != nil {
		w.WriteHeader(http.StatusNotAcceptable)
		return
	}
	r.Body.Close()
	err = json.Unmarshal(body, &p)
	if err != nil {
		w.WriteHeader(http.StatusNotAcceptable)
		return
	}
	err = DB.NewPerson(p)
	if err != nil {
		w.WriteHeader(http.StatusInternalServerError)
		json.NewEncoder(w).Encode(err)
		return
	}
	w.WriteHeader(http.StatusCreated)
	json.NewEncoder(w).Encode(p)
}

func GetPeople(w http.ResponseWriter, r *http.Request) {
	people, err := DB.GetAllPeople()
	if err != nil {
		w.WriteHeader(http.StatusInternalServerError)
		json.NewEncoder(w).Encode(map[string]string{"error": err.Error()})
		return
	}

	w.Header().Set("Content-Type", "application/json")
	w.WriteHeader(http.StatusOK)
	json.NewEncoder(w).Encode(people)
}

func main() {
	fmt.Println("Hello, World!")
	InitDB()

	router := NewRouter()

	shutdownSignal := make(chan os.Signal, 1)
	signal.Notify(shutdownSignal, syscall.SIGINT, syscall.SIGTERM)
	<-shutdownSignal

	// shutdown web server
	ctx, cancel := context.WithTimeout(context.Background(), 5*time.Second)
	defer cancel()
	if err := router.Shutdown(ctx); err != nil {
		fmt.Printf("error shutting down server: %s", err.Error())
	}
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>My React App</h1>
      </header>
      <Router>
        <Routes>
          <Route path="/" element={<People />} />
          <Route path="/new-person" element={<NewPerson />} />
        </Routes>
      </Router>
    </div>
  );
}

function People() {
  const [people, setPeople] = useState<Person[]>([]);

  useEffect(() => {
    // Fetch people data
    fetch(`${api.host}/people`)
      .then((response) => response.json())
      .then((data: Person[]) => setPeople(data))
      .catch((error) => console.error('Error fetching people:', error));
  }, []);

  return (
    <div>
      <h2>People List</h2>
      <ul>
        {people.map((person) => (
          <li key={person.id}>
            <h3>{person.name}</h3>
            <p>{person.email}</p>
          </li>
        ))}
      </ul>
    </div>
  );
}

