function NewPerson() {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');

  const handleSubmit = async (event: React.FormEvent) => {
    event.preventDefault();

    const newPerson = {
      name: name,
      email: email,
    };

    try {
      const response = await fetch(`${api.host}/person`, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(newPerson),
      });

      if (!response.ok) {
        console.error('Failed to add new person:', response.statusText);
        return;
      }

      const data = await response.json();
      console.log('New person added:', data);
    } catch (error) {
      console.error('Error adding new person:', error);
    }
  };

  return (
    <FormContainer>
      <FormTitle>Add New Person</FormTitle>
      <form onSubmit={handleSubmit}>
        <FormGroup>
          <Label>Name:</Label>
          <Input
            type="text"
            value={name}
            onChange={(e) => setName(e.target.value)}
            required
          />
        </FormGroup>
        <FormGroup>
          <Label>Email:</Label>
          <Input
            type="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
          />
        </FormGroup>
        <SubmitButton type="submit">Add Person</SubmitButton>
      </form>
    </FormContainer>
  );
}

